            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"figure\"><a></a> <$link to=\"$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000350\"><img src=\"OEBPS/781724791791128825_z006-s.jpg\" alt=\"Lord Dexter and his Dog.\"></$link><br>\nLord Dexter and his Dog.</div></div>"
