            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">We ne'er shall look upon his like again.</p></div></div></div>"
        },
