        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000050": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000050",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>Ime the first Lord in the younited States of A mercary Now of Newburyport it is the voise of the peopel and I cant Help it and so Let it goue Now as I must be Lord there will foler many more Lords prittey soune for it Dont hurt A Cat Nor the mouse Nor the son Nor the water Nor the Eare then goue on all in Easey Now bons broaken all is well all in Love Now I be gin to Lay the Corner ston with grat Remembrence of my father Jorge Washington the grate herow 17 sentreys past before we found so good A father to his children and Now gone to Rest Now to shoue my Love to my father and grate Carieters I will shoue the world one of the grate Wonders of the world in 15 months if Now man mourders me in Dors or out Dors such A mouserum on Earth will annonce O Lord thou knowest to be troue fourder hear me good Lord I am A goueing to Let or shildren know Now to see good Lord what has bin in the world grat wase back to own fore fathers Not old plimeth but stop to Addom &amp; Eve to shoue 45 figers two Leged and fore Leged becose we Cant Doue well without fore Legd in the first plase they are our foude in the Next plase to make out Dexters mouseum I wants 4 Lions to defend thous grat and mistry men from East to wist from North to South which Now are at the plases Rased the Lam is Not Readey in short meater if Agreabel I forme A good and peasabel govement on my Land in Newburyport Compleat I take 3 presedents hamsher govener all to Noue York and the grate mister John Jay is one, that maks 2 in that state the king of grat britton mister pitt Roufus King Cros over to france Loues the 16 and then the grate bonnepartey the grate and there segnetoure Crow biddeyâI Command pease and the gratest brotherly Love and Not fade be Linked to gether with that best of troue Love so as to govern all nasions on the fass of the gloub not to tiranize over them but to put them to order if any Despout shall A Rise as to boundreys or Any maturs of Importence it is Left france and grat britton and Amacarey to be setteled A Congress to be always in france all Despouts is to be thare seteled and this may be Dun this will balless powers and then all wars Dun A way there <span class=\"pagenum\"><a></a>[15]</span> fore I have the Lam to lay Dow with the Lion Now this may be Dun if thos three powers would A geray to Lay what is called Devel one side and Not Carry the gentelman pack hors Any longer but shake him off as dust on your feet and Laff at him there is a grate noise aboute a toue Leged Creter he says I am going to set sade black Divel there stop he would scare the womans so there would be No youse for the bilding I should have to E rect sum Noue won Now I stop hear I puts the Devil Long with the bull for he is a bulling 2 Leged Annemal stop put him one side Near Soloman Looking with Soloman to Ladey venus Now stop wind up there is grat ods in froute I will Let you know the sekret houe you may see the Devel stand on your head before a Loucking glass and take a bibel in to your bousom fast 40 owers and look in the loucking glass there is no Devilif you dont see the ould fellow but I affirm you will see that ould Devel</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000051": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000051",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>Unto you all mankind Com to my hous to mock and sneare whi ye Dont you Lafe be fore god or I meane your betters think the heir power Dont know thorts and Axsions Now I will tell you good and bad it is Not pelite to Com to see what the bare walls keep of my ground if you are gentel men you would stay Away when all is Dun in marble I expect to goue out myself to Help if thous grat men will send on there Likeness all over the younited States I wish all the printers to give Notis if pleases to in form by printen in the Nouspapers for the good of the holl of man kindâââ</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000052": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000052",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>I waus to make my Enemys grin in time Lik A Cat over a hot puding and goue Away and hang there heads Doun Like a Dogg bin After sheep gilty stop see I am Afrade I Rite toue hash my peopel Complane of backker spittel maks work to Cleane it upââin the women skouls A bout it spit in ther hankershif or not spit A tall I must say sumthing or I should say Nothing therefore make sum Noise in the world when I git so ouely to Nash my goms and grising for water and that is salt water when brot A yong Devel to bring it and A Scoyer to wate and tend on gentelmen A black Suier his breth Smelt wos then bram stone by far but Let the Devel goue in to Darknes an takeld his due to Descare mankind for A Littel while this Cloven foot is seen be sum but the trap will over hall the Devel in tim I pittey this poore black man I thinc his master wants purging a Littel to har ber mr Devel A most but I did Not say Let him Run A way good Nit mr Devel Cary the sword and mwney with you tak John mekel Jentel man good Not</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000053": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000053",
