            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\">T DEXTER</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000054": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000054",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p><span class=\"pagenum\"><a></a>[16]</span></p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000055": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000055",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><h3>THIS COMETH GREETING</h3></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000056": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000056",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>mister printers the Igrent or the Nowing wons says I ort to Doue as thay doue to keep up Cheats or the same thing Desephons to Deseave the Igrent so wee may Cheat and Likewise have wars and plunder my wish is all Liers may have there part of fier and brimstone in this world or at least sum part of it or Else the gouement is Not good it will want pourging soone if A Lawyer is to way Lay a man and brouse him unmassely All most to Death A sitteson that pays twentey fore Dolors for Careags and not more then one Dolor A week to ment the hiways and my being Libperel is in part of this bloddey Afare No sauage would beat a man as I was beaten almost to Death I Did not know houe these men Came to keep sade Lawyer from quit killing of me till sum time After three men saw the Axon of the blodey seene without massey and carried sade Dexter in to the house sun fanting or Neare to se and behold the orful site bleading and blind of one Eye twoue brousings in two hours at Least Now Laws in this part of the world for A man of money to Live those I lend money to and A Lawyer and others thay youse me the wost it maks Inemys then these Rogs if there is Any that call me A soull and pick a Qualrel with me A bout my Nous papers so as to pay the Lawyer Craft to make up the molton Calf A molton Calfe Not an Ox Now the town of Chester has Lost two <i>Hundred wate of Siver</i> at Least I beleuv more money Now thay may have me in the town or A Lawyer Chouse for yourselves my frinds and felow mortels pease be with you All A men selagh finely brethren sum thing more Comingââ</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000057": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000057",
