        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000058": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000058",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\">TIMOTHY DEXTER</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000059": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000059",
