            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\">\n\n</div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000060": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000060",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><h3><span class=\"sc\">For the Impartial Herald.</span></h3></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000061": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000061",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p><i>Messrs. Blunt &amp; March</i>,</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000062": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000062",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>I say to whom it may concernâto the majesty of the people of Newburyport, Greetingâ</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000063": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000063",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>It costs Eight hundred Dollars a year to support a watch in this town, and yer gentlemen's windows are broken, fences pulled down and Cellars broken open, and much other misdemeanors done at night. Are the watch asleep, or are they afraid to detect those who are guilty of such practises? Boast not of it if you call this Liberty and Equality. Newburyport has had the name of being <span class=\"pagenum\"><a></a>[17]</span> a very civil worthy place; it is a great pity some bad boys or young men should disgrace it. I hope our worthy and honorable rulers will bring those rude lads to see themselves and lick the dust like serpents, and ask forgiveness of their betters, and do so no more, but repent and live.</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000064": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000064",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>Now fellow citizens is it wisdom, is it policy, to use a man or men so shocking bad as to oblige them to leave the town where they paid one Dollar a day to support government?</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000065": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000065",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>A friend to good order, honor to whom it belongsâto great men a friendâto all good citizens and honest men good bye.</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000066": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000066",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\">\n\n</div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000067": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000067",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>Whereas many philosophers has judged or guessed at many things about this world, and so on. Now I suppose I may guess, as it is guessing times. I guess the world is one very large living creature, and always was, and always will be without any end from everlasting to everlasting, and no end. What grows on this large creature is trees and many other things. In the room of hair the rocks is moulds. This is called land where the hair grows, the belly the seaâall kinds of fish is the worms in the belly. This large body wants dressing to get our living of this creature and by industry we get a livingâwe and all the animal creation is less than fleas in comparison on the back or belly of this very large immense body. Among the hairs to work this great body is that of nature, past finding out.âAll we know is we are here, we come into the world crying and go out groaning. Mankind is the master beast on the earthâin the sea, the whale is the head fishâthe minim is the smallest fishâthe great fish eat up the little ones, and so not only destroy one another, but they are master over the whole of beasts and fish, even over a lion, therefore man is the masterly beast and the worst of the wholeâthey know the most, and act the worst according to what they know. Seeing mankind so bad by nature, I think when the candle goes out, men and women is done, they will lay as dirt or rocks till the great gun fires, and when that goes off the gun will be so large that the gun will contain nine hundred million tons of the best of good powder, then that will shake and bring all the bones together, then the world will be to an end. All kinds of music will be going on, funding systems will be laid aside, <span class=\"pagenum\"><a></a>[18]</span> the melody will be very great. Now why cant you all believe the above written as well as many other things to be true; as well as what was set forth in the last Centinel concerning digging up a frog twenty five feet below the surface, where it was most as hard as a rockâthere was his shape like taking a stone out of a rockâThis is from a minister. Now why wont you believe me as well.</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000068": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000068",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\">\n\n</div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000069": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000069",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><h3>WONDER OF WONDERS!</h3></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000070": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000070",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>How great the soul is! Do not you all wonder &amp; admire to see and behold and hear? Can you all believe half the truth, and admire to hear the wonders how great the soul isâonly beholdâpast finding out! Only see how large the soul is!âthat if a man is drowned in the sea, what a great bubble comes up out of the top of the water! the last of the man dying under waterâthis is windâis the soul that is the last to ascend out of the deep to gloryâit is the breath from on high doth go on high to glory. The bubble is the soul. A young fellow's for gunning for the good of bodies and souls.</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000071": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000071",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\">\n\n</div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000072": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000072",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>My frinds &amp; felow mortals there is A first Cose of all things most Comle so it Came to pass that one Abraham bish up got A qanted with my Dafterâshee A babey he Old in Eage and Larning and Colage Lant &amp; Lawyer Lant and preast Lant and masonik Lant and Divel Lant he was then Nothing as for Cash he being A fox and A old fox he was After the graps he tasted of them he Cryed out fower this Anne meal sent my Dafter home he sad A b did Not git all the Lovs &amp; Littel fishes but got A part and Now 9 years I have Now had my Dafter Crasey in &amp; by the Cose of this wild A &amp; b hell on Earth o o pittey me All good felow mortels sade Creater A b mad with Larning &amp; as pour as A snake and as proud as Lousfer he sade his father was worth twenty thosand Dolors &amp; he was Not more than five thousand Dolors he send for bishup bass to be mared befor dublessed &amp; Insisted to be maried he says Daxter may Crye them Down in the Lore Reogon After sum time thay got published then he in sisted Not to have Any witness went and <span class=\"pagenum\"><a></a>[19]</span> hid finly my gost my wife that was the gost 13 yearst Last march thay where maried I was maried to the gost thirtey five Last may I have bin in hell all the time more so sence Abraham bishup got in to my house he hurt me and familey one tun of silver it was the Cose of my parting with mis Dexter Now I Am free Now for A wife that has A sole the gost was A gisard &amp; A Cose all Round her A b striking my Dafter on hur side as shee swares to grat Lawyer Dexter and to many others I be Leave it that knows the trouth the bloue he gave hur on the side shee had to put plasters on her side Neare three years when Likker is in the wit is scattered A b is the beast or Creater two Leged Conekett boull short Nek boull head thik hare big sholders black Corlley hare he wants to be A god but what I sot sade Creater Down at short A quatence I Can prove it my selfe by men of the sekent magentoude my gesing of the Creater it tourned out According to my gessing and when I see my father the grat good man father Thomas gefsion I will Let the Cat out of the bag and give Lite to the blind sade A b will Doue for sum offess Everye Annemel will Doue for sumthing A b will mak a midling good CAMP COLLEMON A thing hier if I am a Roug in grane so be it A Lepard Cant Alter hur spots Nor beaver wont groue on A houk back I be Leave if my father the presente koue the holl trouth of A b treatment to my Dafter from her mouth the grat man woul shead tears with greafe and all good peopel Like wise shocking is the A fare</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000073": {
