        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000076": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000076",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>To man kind at Large I Never had the honour to be Long I meane to that onerabel mesonek Order I Noked once once twise three times &amp; the gohst Apeared sade thou shall Not enter be Cose I have toue much knowledge in my headâI sopose had I bin one then should bin to keep open Dors for thives &amp; Robers I have Rougs plentey without keeping tavern I Dont wont Now Abrahams Nor Aney of the order only fict Ladeys mared and grat gentil men that belongs out of the town mared peopol and fine widders I wish to see with pleasur for I wonts to marey A fine wider for I hant had Now wife for thirteene years Next orgest I gave the gost fore hundred wate of silver to quit the state grat Lawyer passons the gient of the Law Rote the Contract the Cose of it was that mis <span class=\"pagenum\"><a></a>[20]</span> Dexter that was would have my Dafter marey to A bishup Cosed the A greement the sole Cose she has two trousteays which have the money to deal out the intress and shee is so ginress shee bys hur Neadels I bys the pins &amp; sisers &amp; all things Else shee Leaves the in tress in the hands of the trosteys I must have A Companon soun good by all At present with glorey</p></div>"
        },
