            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000078",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>I ask for giveness of the world of mankind for teling the trouth I meane No hurt to A flie only when he bits me then I kils the flye if I can I have bin my one tromter fore teene years my tromter is Dead my haveing so many wounds in fas and on my head I Doue it to make a good Lafe to keep my sperets from sinking pittey me all good peopel A men</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000079": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000079",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>and fourder I maried widder frothingham shee had fore Children the holl of all there stats was short of thirteene houndred Dolors this woman groed mad shee sade shee must goue to hell goue ferting for I have fined A ganst the holey goast un pardinbell sin shee was for making way with hur selfe in three monts I got the best minister in town to Lay the gost he prayed hartey but Could Not Laye the serpent only in part shee has bin Cracey Every sence it is A wonder I am A Live two children suked hur brestâit is heretarey two Children maried now Live upon me being disorded thay beat me offen with Death Cloube &amp; the old gost toue bad to say I be silent under serkoumstanes I mus Cout &amp; Roum sell the one of the first plases all most in the world for I am in grat fear of my Life being taken A way such blows I have had from toue or three gost in my familey is worth twelve hundred hoxets of geamator best shougers Even A saxton to take the blows I wodent for fifty milon Dollors words cant Express the bloddey war in my familey three gosts all Noys Robing of me I must sell with tears in my Eys I Cant see to Rite Aany more fare well I say good bye</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000080": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000080",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\">T DEXTER</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000081": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000081",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"figure\"><a></a> <$link to=\"$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000352\"><img src=\"OEBPS/781724791791128825_z024-s.jpg\" alt=\"\"></$link><br></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000082": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000082",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p><span class=\"pagenum\"><a></a>[21]</span></p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000083": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000083",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>How Did Dexter make his money Inw ye says bying whale bone for stain for ships in grosing three houndred &amp; 40 tuns bort all in boston salum and all in Noue york under Cover oppenly told them for my ships thay all Lafed so I had at my one prise I had four Couning men for Rouners thay souned the horne as I told them to Act the fool I was foull of Cash I had Nine tun of silver on hand at that time all that time the Creaters more or Less Lafing it spread very fast heare is the Rub in fifty Days thay smelt A Rat found whare it was gone to Nouebry Port speklaters swarmed Like hell houns to be short with it I made seventey five per sent one tun and halfe of silver and over one more spect Drole A Nouf I Dreamed of warming pans three Nits that thay would doue in the west ingas I got not more than fortey two thousand put them in Nine vessele for difrent ports that tuck good holdâââI cleared sevinty nine per sentâââthe pans thay mad yous of them for Coucking very good master for Coukey blessed good in Deade missey got Nise handed Now bourn my fase the best thing I Ever see in borne days I found I was very luckkey in spekkelasion I Dreamed that the good book was Run Down in this Countrey Nine years gone so Low az halfe prise and Dull at that the bibbel I means I had the Readey Cash by holl sale I bort twelve per sent under halfe prise thay Cost forty one sents Each bibels twenty one thousand I put them into twenty one vessels for the westinges and sent A text that all of them must have one bibel in Every familey or if not thay would goue to hell and if thay had Dun wiked flie to the bibel and on thare Neas and kiss the bibel three times and Look up to heaven Annest for giveness my Capttens all had Compleat orders heare Coms the good Luck I made one hundred per sent &amp; Littel over then I found I had made money A Nuf I hant speck A Lated sence old times by goverment secourties I made or cleared forty seven thousands Dolors that is the old A fare Now I toald the all the sekrett Now be still Let me A Lone Dont wonder Now more houe I got my money boaz</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000084": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000084",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\">T DEXTER</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000085": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000085",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\">\n\n</div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000086": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000086",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>Now to all onnest men to pittey me that I have bin in hell: 35 years in this world with the gost A woman I maried and have two Children Now Liveing Abram bishup mared my Dafter sence the troubel is such that words Cant be Exprexed Nine years disorded <span class=\"pagenum\"><a></a>[22]</span> for a tun of silver for three months I could Not have the gost in my pallas sleep Not have to be had Now to save my Life I will sell if Not I will Let the house it is as Notted as Any hous in the oile shouls and furder in the world or sence Noers Arke &amp; sence the floud taking in my self finly such A plase No whare in the world all gous with it hoses chareags all but plate &amp; gouels A Reserve the holey bybel and one bouck more my old head has wore out three boddeys it would take a journey of Docters one our to find and Count the scars on my head given by the goust &amp; others Amen</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000087": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000087",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>Joune 12- 1805 Clean trouth</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000088": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000088",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\">T DEXTER</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000089": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000089",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\">\n\n</div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000090": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000090",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>I say the grate mister Divel that has so maney Nick Names a frind to the preasts Now is dead all and the pope Likewise and the founders of mesonic A Cheat foull of war and gratness of hell Dead preasts Dead and Lawyers Damede Deade A braham b bi Ass Dead and All the frinds of mankind sings prasses that wee are the grat familey of mankind Now out of hell Deleured from fire and smoak bourning for Ever Now all in heaven uppon Earth Now all frinds Now for A Day of Regoising all over the world as one grate familey all Nasions to be ounited No more wars for fifty years and Longer I Recommend pease A Congress in france and when wee are Ripe for A Emper in this Contrey Call for me to take the helm or a Consler in the Afare of trouth Amen and Amen</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000091": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000091",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\">TIMOTHY DEXTER</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000092": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000092",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>P Sâone thing further I happened not to think of that grate Creature which some fools Call the Goast and others say that he is wantedâBut I thing that it will be of searvice to let the Thanttron Dye</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000093": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000093",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\">T DEXTER</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000094": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000094",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\">\n\n</div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000095": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000095",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>Scarting trouths fortey six years gone old french war to git men and Lads to List the prests told them thay would Live as Long as if thay staed at home for Every boulitt had its Commison from the Lord he directed them one time when old good mister Emmerson had A gurnemon to preach I heard him say for Addom sin there was Now in hell milons of milons of Children Not more than A <span class=\"pagenum\"><a></a>[23]</span> span Long all this is troue and when there was a A Drouth most over thay would Call A fast and pray very Annest for the bottels of heaven to be on Corked so the Rane mit Com Down the minester did Not say how Larg thay whare I gess they held five hundred hoxetts Each</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000096": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000096",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>1805 may 27</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000097": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000097",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\">TIMOTHY DEXTER</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000098": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000098",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\">\n\n</div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000099": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000099",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>Trouth I afirme I am so much of A foule the Rougs want to git my Jouels &amp; Loavs &amp; Littel fishes without my Leave Leave is Lit thay all Caled me A foull forty years Now I will Call all fouls but onnes men Now to brove me A foull I Never Could sing Nor play Cards Nor Dance Nor tell A Long storey Nor play on Any mouskel Nor pray Nor make A pen when I was young I Could play on A Jous harp it would mak my mouth warter and the Ladeys sumthing warter gess what I sade Nothing A good Lafe is beter than Crying A Clam will Cry And warter wen thay are out of there Ellemen so wee the same if I had Not the gost in my house I would I mean give Lite to my brothers &amp; sisters and have A pease all over the world and beat the trouthe into my frinds houe goud it is houe onnest it would be and houe man kind has bin in posed upon &amp; houe thay have bin blinded with untrouths gosts and mister Divels there is Now None of that order all Lye the mesonek if thay wilt make a book of trouth I will give the Creaters but I will take the Chare and put my frind bonne partey on my Rte hand And the grat ginrel meroue on my Left hand A Nuf to give the sword is in the banks A Emper only be still I will take the helm in Love I am A quaker No blod spiled all in the Love of A Emper you will have in fortey years I may Com back &amp; see houe you all goue on &amp; what you ware when the gost is gone and mister Divel pease on Earth be fore I will have a war in my Day I will be your frind the Emper and if I want help I will Call my frind boneypartey and gorge the third &amp; Dewide the Lose Now take Care peas I say Except of what is Rewealed to me for it will Com to pass I was born when grat powers Rouled I was borne in 1747 Janeuarey 22 on this day in the morning A grat snow storme the sines in the seventh house wives mars Came fored Joupeter stud by houlding the Candel I was to be one grat man mars got the beth to be onnest man to Doue good to my felow mortelz I think I am A quaker <span class=\"pagenum\"><a></a>[24]</span> but I have so Littel sense I Cant Deseave I Can swep my hous &amp; git all A Noue gelt &amp; goue out of hell is bless Law and trouth and Reason on my side it must be done when I git my worthy widdow it is Dun Not one word of Anger as Long as I Live to a A good woman I a firme</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000100": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000100",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\">TIMOTHY DEXTER</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000101": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000101",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>fourder I Dont have Aney of the Ladeys of prinsbell spend the Intress I will spend Day and Nite All I have and Doue all the good to please I can make as much heaven upon Earth as posbel and then Dye in peas A men and Amen for A Companon I must have to make out this heaven then I am happy the goue in the dark in pease when the Candel gous out in theâLord god of Nater one more A men good bye</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000102": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000102",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\">T DEXTER</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000103": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000103",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>forder A grate good man Came to see me Not Long sence I told sade man I had many Innemys he says be Cos you are toue onnest to be beloved you Dont gine in Comon ways with Rougs bibel making mesonik order to promes to pay &amp; Never pay only with A Lye and gine heell on Earth Cheat all you Can gine the mob then you are A brother Now I am glad I did Not Nock the Doer Down my good Louck my god and my god blessed be my good Luch</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000104": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000104",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\">T DEXTER</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000105": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000105",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>sum more sweet meats &amp; trouths I say Now man sence Noers Ark Dare to Rite of so Littel Laning I begon when abrham was in my hous I then Rote this world was hell &amp; men was Divels sum better then others sum white Divels sum black &amp; sum Copper Divels I for got them bloue Divels this spred far was printed in many papers a bishop Cosed my blood to bile thirteene years last March as when I begun to Rite I sade the grat Rougs was the best men o o for shame the onnest man was Lafed at &amp; a b being foull of Larning it maks him mad to be a Lousefer his Rane is short I hope to see my father the grat felosfer the presedent before I die the trouth he must know a men</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000106": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000106",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\">T DEXTER</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000107": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000107",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>I Crys Crys Lik a babey when I Rits my trobel is so grat to have my Dafter so Crasey the Rick of our Lives such blows with such weapons of a sudden &amp; strike such brouses is worth thirty <span class=\"pagenum\"><a></a>[25]</span> millon of Dolors for a pouer man to have and others o brous me thay wont my Life to git my money &amp; so I must seel &amp; be a sitteson of the world it is a wonder I am a Live the burds will Chip offen before I Can git to sleep the Noys is so grate all hell No more a b bishups he wants to be Deatey Let sade beast goue once &amp; twise act so Now toue much Laning make Rougs and fouls in the Eand Dig a Dich &amp; fall in to it white Rop or a hare Rop taks them in time</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000108": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000108",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\">trouth</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000109": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000109",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\">\n\n</div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000110": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000110",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>This is revealed to me how the world was made with what stuff it was made with is the question Now I tell the with paper pen and ink and type the Anemels to be the founders of it with a Lye &amp; Lyes upon Lyes wose then beasts or Snaks or wouls or bars tigers Divils and ten times wose with all Lyes untrouths the world allways was and is Look out for trouth a men I</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000111": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000111",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\">TIMOTHY DEXTER</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000112": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000112",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>fourder in six Days and verey good and harde Laber I Cant gitt my monement Dun in sixty Days and work hard very hard &amp; sweet it was for want of maney hands I had No hiram Nor Solomon only my selfe</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000113": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000113",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\">T DEXTER</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000114": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000114",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>World makers mankind with marbel and parchment and paper pen &amp; ink and printers tips and Lyes upon Lyes amen and amen the world was made in six Days out of Nothing o yess o lye Now all troue Lye yess all the world over</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000115": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000115",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\">TIMOTHY DEXTER</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000116": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000116",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p><span class=\"pagenum\"><a></a>[26]</span></p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000117": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000117",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><h2>APPENDIX.</h2></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000118": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000118",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"center\">IN HONOR OF<br>\nTIMOTHY DEXTER, ESQ.</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000119": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000119",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>This great philosopher may indeed be styled a phenomenon in nature! The many literary qualifications he possesses rank him foremost among literary characters.ââThat unequalled production from the pen of this wonderful philosopher, denominated &quot;<i>A Pickle for the Knowing Ones</i>,&quot; has not only received universal applause, and been ranked as of the first magnitude in the literary world, but has had such rapidity in its sale, that a copy cannot be procured, though diligently sought after by men of the most transcendant merit.</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000120": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000120",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>Where can we find a man so extensively useful, and so eminently calculated to diffuse light to a dark and ignorant multitude, as this rare philosopher? How penetrating his understanding! How deep his ideas! What a multitude of discoveries which before were hid in embryo, have made their appearance at the nod of his genius! Surely we may say, Blessed are the people who are highly favored with the greatest Luminary that ever gave light to an existing world!!</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000121": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000121",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>While aiming at a just portrait of this remarkable Naturalist and Philosopher, his generosity is no less a subject of admiration, than his literary and philosophical abilities. The readiness with which his benevolent soul bestows donations calls forth the grateful acknowledgement of all who have been liberally assisted from his bountiful hand.</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000122": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000122",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>See him the first to assist in building a church for the worship of God! See him liberally give for the purchase of bells, the ready cash, without hesitation! See him expending his fortune to preserve in everlasting romembrance, characters who have shone with <span class=\"pagenum\"><a></a>[27]</span> unexampled greatness in Europe and America! Here the subject fails. Vain man may as well attempt to stop the course of nature, as to do ample justice to this wonderful man!</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000123": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000123",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\">\n</div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000124": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000124",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000125": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000125",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">Behold all nature stands aghast</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000126": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000126",
