            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000155",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">Great DEXTER, did the world do right,</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000156": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000156",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000157": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000157",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">Thy name would shine with brilliant light!</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000158": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000158",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000159": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000159",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">Each would declare thy wond'rous fame,</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000160": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000160",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000161": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000161",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">And shout at DEXTER'S mighty name!</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000162": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000162",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000163": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000163",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\">\n</div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000164": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000164",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\">\n\n</div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000165": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000165",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\"><span class=\"sc\">Salem</span>, <i>June 14, 1805</i></p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000166": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000166",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p><span class=\"sc\">My Lord Dexter</span>,</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000167": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000167",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>By the politeness of Mr. <i>Emerson</i> I received the very valuable contents of your package. A new edition of that unprecedented performance, entitled &quot;A Pickle for the Knowing Ones,&quot; &amp;c. is very urgently called for by the friends of literature in this country and in Englandâand I presume with the additions and improvements intended to accompany the second edition, provided it should be well printed, would entitle the author to a seat with the Disciples of Sir Joseph Banks, if not to a place in Bonaparte's Legion of Honorâfor my Lord DEXTER is an honorable man. But, sir, the work cannot be executed for the sum namedânor in the time specified.âI will print an edition of 500 copies with the additions, for fifty dollars, and cannot possibly do them for less.</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000168": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000168",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>Wishing your Lordship health in perpetuityâa continuance of your admirable reasoning facultiesâgood <i>spirits</i>, and an abundance of wealthâand finally a safe passage over any river not with <i>Sticks</i>, but a pleasure boat, I remain yours with the utmost profundity.</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000169": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000169",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\">W. CARLTON.</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000170": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000170",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"quote\"><i>The Right Honorable Lord</i> <span class=\"sc\">Dexter</span>,<br>\n<i>Kt. Newburyport</i>.</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000171": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000171",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p><span class=\"pagenum\"><a></a>[28]</span></p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000172": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000172",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\">\n\n</div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000173": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000173",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p><i>The follering peases are not my Riting but very drole</i></p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000174": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000174",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"right\">TIMOTHY DEXTER</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000175": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000175",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p><span class=\"sc\">Mr. Melcher</span>,</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000176": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000176",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"quote\"><i>Your publishing the following extract from a letter said to be from a trader among the Indians to a friend, may amuse some of your customers for the Gazette.</i></p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000177": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000177",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>A few days ago one of the Indians paid me a visit. After some conversation, he said that a minister from the United States had been with his tribe to teach them the Christian religion. He says that there is but one only living and true God, who is a good, wise, and powerful spirit (this Indian say too) and that there are three persons in the god head, of one substance and power, God the father, God the Son and God the Holy Ghost, that the Father is of none, neither begotten, or proceeding, the Son is eternally begotten of the Father, the Holy Ghost eternally proceeding from the Father and the Son, and that the Holy Ghost visited a virgin, and conveyed the Son into her; where he continued nine moons and then was born like other children, was born God and man, that when he was about thirty years old began to preach, but the great men no like his preaching, sent their warriors, who took and killed him.</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000178": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000178",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>Indians ask what all this talk mean, he say that the first man and woman broke God's law in eating what God had forbidden, that therefore they and all the children that should proceed from them must die, and be punished after death forever; that the Son came and died to save some of mankind from being punished after death. Oh! 'trange that man could kill God the Son, and that his death be of service to mankindâgreat many people die before the Son of God, and did not know any thing about himâit was then asked whether his dying would do poor Indians any good; he say yes, if they believe; then me say that pappoose no believe them do no good; he say you must leave that with God, and believe for yourselfâone say it is hard to believe such 'tories; if Indian tell such 'trange things, the white people no believe um.</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000179": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000179",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p><span class=\"pagenum\"><a></a>[29]</span></p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000180": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000180",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"quote\"><i>A curious Sermon, by the Rev. Mr. Hyberdin, which he made at the request of certain thieves that robbed him on a hill near Hartlgrow, in Hampshire, (England) in their presence and at that instant.</i></p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000181": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000181",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>I greatly marvel that any man will disgrace thieving, and think that the doers thereof are worthy of death, considering it as a thing that cometh near unto virtue, being used in all countries, and allowed by God himself; the thing which I cannot compendiously show unto you at so short a warning, and on so sharp an occasion. I must desire you, gentle audience of thieves, to take in good part what at this time cometh into my mind, not doubting but that you, through your good knowledge, are able to add much more unto it, than this which I shall now offer unto you.</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000182": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000182",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>First, Fortitude and stoutness of courage, and also boldness of mind, is commended of some men to be a virtue; which being granted, who is there then that will not judge thieves to be virtuous? For they are of all men the most stout and hardy, and the most void of fear; for thieving is a thing usual among all men; for not only you that are here present, but also many others in divers places, both men, women and children, rich and poor, are daily of the faculty, as the hangman at Newgate can testify; and that it is allowed of by God himself is evident from Scripture; For if you examine the whole course of the Bible you will find that thieves have been beloved of God; for Jacob, when he came out of Mesopotamia, did steal his uncle Laban's kids. The same Jacob did also steal his brother Esau's blessing; and yet God said, <i>I have chosen Jacob and refused Esau</i>. The children of Israel, when they came out of Egypt, did steal the Egyptian's jewels of silver and jewels of gold, as God commanded them to do.</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000183": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000183",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>David, in the days of Abiathar, the high priest, came into the temple and stole the hallowed bread; and yet God said, &quot;David is a man after my own heart.&quot; Christ himself, when he was here on earth, did take an ass and colt that was none of his; and yet God said, &quot;This is my beloved son, in whom I am well pleased.&quot; <i>Thus you see that God delighted in thieves.</i></p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000184": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000184",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p>But most of all I marvel that men can despise thieves, whereas in many points you be like Christ himself; for Christ had no dwelling place no more than youâChrist at length was caught, and so will youâhe went to hell and so will you. In this you differ from him, for he rose and went into heavenâso you will <span class=\"pagenum\"><a></a>[30]</span> never do without God's great mercy, which God grant you. To whom with the Father, Son and Holy Ghost, be all honor and glory, for ever and ever. <span class=\"sc\">Amen.</span></p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000185": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000185",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\">\n\n</div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000186": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000186",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><h3><span class=\"sc\">From the Providence PhÅnix of December, 1804.</span></h3></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000187": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000187",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"center\">MARQUIS OF NEWBURYPORT!!</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000188": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000188",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"quote\">[<i>On Monday last arrived in this town the most noble and illustrious Lord TIMOTHY DEXTER, of Newburyport, Massachusetts, who has since his arrival requested the publication of the following stanzas in this day's paper, as a humble tribute to the incomprehensible majesty of his name! While they serve as a brilliant specimen of the gifted talents and admirable sublimity of the Laureat, from whose pen they flowed, the virtuoso in genealogies, and the worshippers of noble rank and boundless fortune may derive a rich and delicious satisfaction from the subject to which they are devoted!</i></p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000189": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000189",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\">\n\n</div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000190": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000190",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><p class=\"center\">ADVERTISEMENT EXTRA.<br>\n<small>OF THE CELEBRATED</small><br>\nLORD DEXTER.</p></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000191": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000191",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\">\n</div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000192": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000192",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000193": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000193",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">LORD DEXTER is a man of fame,</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000194": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000194",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000195": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000195",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">Most celebrated is his name;</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000196": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000196",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000197": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000197",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">More precious far than gold that's pure,</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000198": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000198",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000199": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000199",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">Lord Dexter live for evermore.</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000200": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000200",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000201": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000201",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\">\n</div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000202": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000202",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000203": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000203",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">His noble house it shines more bright</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000204": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000204",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000205": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000205",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">Than Lebanon's most pleasant height,</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000206": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000206",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000207": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000207",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">Never was one who step'd therein</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000208": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000208",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000209": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000209",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">Who wanted to come out again.</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000210": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000210",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000211": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000211",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\">\n</div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000212": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000212",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000213": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000213",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">His house is fill'd with sweet perfumes,</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000214": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000214",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000215": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000215",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">Rich furniture doth fill his rooms;</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000216": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000216",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000217": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000217",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">Inside and out it is adorn'd,</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000218": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000218",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000219": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000219",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">And on the top an eagle's form'd.</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000220": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000220",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000221": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000221",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\">\n</div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000222": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000222",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000223": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000223",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">His house is white and trimm'd with green,</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000224": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000224",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000225": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000225",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">For many miles it may be seen;</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000226": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000226",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000227": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000227",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">It shines as bright as any star,</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000228": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000228",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000229": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000229",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">The fame of it has spread afar.</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000230": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000230",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000231": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000231",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\">\n</div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000232": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000232",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><p><span class=\"pagenum\"><a></a>[31]</span></p></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000233": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000233",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\">\n</div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000234": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000234",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000235": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000235",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">Lord Dexter, thou, whose name alone</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000236": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000236",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000237": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000237",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">Shines brighter than king George's throne;</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000238": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000238",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000239": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000239",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">Thy name shall stand in books of fame,</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000240": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000240",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000241": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000241",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">And Princes shall his name proclaim.</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000242": {
            "role": "text",
