            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">All enemies who do disturb</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000270": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000270",
            "type": "text/vnd.twpub",
