            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\">\n</div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000314": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000314",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000315": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000315",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">May Washington immortal stand,</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000316": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000316",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000317": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000317",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">May Jefferson by God's command</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000318": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000318",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000319": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000319",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">Support the right of all mankind,</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000320": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000320",
