            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\">\n</div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000324": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000324",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000325": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000325",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">America with all your host,</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000326": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000326",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000327": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000327",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">Lord Dexter in a bumper toast;</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000328": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000328",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000329": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000329",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">May he enjoy his life in peace,</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000330": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000330",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000331": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000331",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\"><p class=\"i2\">And when he's dead his name not cease.</p></div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000332": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000332",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000333": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000333",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\">\n</div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000334": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000334",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-bfe7e4e6c9521d6e-273f9a twpub-bfe7e4e6c9521d6e-6b4cd0\"><div class=\"poem\"><div class=\"stanza\">\n</div></div></div>"
        },
        "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000335": {
            "role": "text",
            "title": "$:/plugins/twpub/bfe7e4e6c9521d6e/text/000000335",
            "type": "text/vnd.twpub",
